const carNames = [
    {
        name: "bmw",
        id: 1,
        parts:[
            {
                id:1,
                partname:"Motor"
            }
        ]
    },
    {
        name: "audi",
        id: 2,
        parts:[
            {
                id:1,
                partname:"Motor"
            }
        ]
    },
    {
        name: "mercedese",
        id: 3,
        parts:[
            {
                id:1,
                partname:"Motor"
            }
        ]
    }
];

export default carNames;
